import React, { useEffect, useRef, useState } from "react";
import { Button, IconButton, TextField } from "@material-ui/core";
import AssignmentIcon from "@material-ui/icons/Assignment";
import PhoneIcon from "@material-ui/icons/Phone";
import MicIcon from "@material-ui/icons/Mic";
import MicOffIcon from "@material-ui/icons/MicOff";
import VideocamIcon from "@material-ui/icons/Videocam";
import VideocamOffIcon from "@material-ui/icons/VideocamOff";

import { CopyToClipboard } from "react-copy-to-clipboard";
import Peer from "simple-peer";
import io from "socket.io-client";
import "./App.css";
import companylogo from "./photos/companylogo.png";

const socket = io.connect("https://webrtc-ncinga.azurewebsites.net/");
// const socket = io.connect("http://localhost:5000");

function App() {
  const [me, setMe] = useState("");
  const [stream, setStream] = useState(null); 
  const [receivingCall, setReceivingCall] = useState(false);
  const [caller, setCaller] = useState("");
  const [callerSignal, setCallerSignal] = useState();
  const [callAccepted, setCallAccepted] = useState(false);
  const [callEnded, setCallEnded] = useState(false);
  const [name, setName] = useState("");
  const [capturedPhoto, setCapturedPhoto] = useState(null);
  const [sessionId, setSessionId] = useState("");
  const [sessionLink, setSessionLink] = useState("");
  const [JoinMeeting, setJoinMeeting] = useState("");
  const [isMicMuted, setIsMicMuted] = useState(false);
  const [isVideoMuted, setIsVideoMuted] = useState(false);

  const myVideo = useRef();
  const userVideo = useRef();
  const connectionRef = useRef();
  const [idToCall, setIdToCall] = useState("");

  useEffect(() => {
    navigator.mediaDevices
      .getUserMedia({
        video: {
          frameRate: 24,
          width: { min: 480, ideal: 720, max: 1280 },
          aspectRatio: 1.33333
        },
        audio: true
      })
      .then((stream) => {
        setStream(stream);
        myVideo.current.srcObject = stream;
      })
      .catch((error) => {
        console.error("Error accessing media devices:", error);
      });

    socket.on("me", (id) => {
      setMe(id);
    });

    socket.on("callUser", (data) => {
      setReceivingCall(true);
      setCaller(data.from);
      setName(data.name);
      setCallerSignal(data.signal);
    });

    const params = new URLSearchParams(window.location.search);
    const sessionIdParam = params.get("session");
    if (sessionIdParam) {
      setSessionId(sessionIdParam);
    }
  }, []);

  const toggleMic = () => {
    if (stream) {
      const audioTracks = stream.getAudioTracks();
      audioTracks.forEach((track) => {
        track.enabled = !track.enabled;
      });
      setIsMicMuted(!isMicMuted);
    }
  };

  const toggleCamera = () => {
    if (stream) {
      const videoTracks = stream.getVideoTracks();
      videoTracks.forEach((track) => {
        track.enabled = !track.enabled;
      });
      setIsVideoMuted(!isVideoMuted);
    }
  };

  const createSession = () => {
    const sessionId = Math.random().toString(36).substring(7);
    setSessionId(sessionId);
    const sessionLink = `${window.location.origin}/?session=${sessionId}/${me}`;
    setSessionLink(sessionLink);
  };

  const Join = () => {
    const parts = window.location.href.split('/');
    const mePart = parts[parts.length - 1];
    setIdToCall(mePart);
    callUser(idToCall);
  };

  const capturePhoto = () => {
    if (stream) {
      const videoWidth = userVideo.current.videoWidth;
      const videoHeight = userVideo.current.videoHeight;

      const canvas = document.createElement("canvas");
      canvas.width = videoWidth;
      canvas.height = videoHeight;
      const ctx = canvas.getContext("2d");
      ctx.drawImage(userVideo.current, 0, 0, videoWidth, videoHeight);
      const dataURI = canvas.toDataURL("image/png");

      const link = document.createElement("a");
      link.href = dataURI;
      link.download = "captured_photo.png";
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);

      setCapturedPhoto(dataURI);
    }
  };

  // const callUser = (mePart) => {
  //   const peer = new Peer({
  //     initiator: true,
  //     trickle: false,
  //     stream: stream,
  //     config: {
  //       iceServers: [
  //         { urls: "stun:stun.l.google.com:19302" },
  //         { urls: "stun:stun1.l.google.com:19302" },
  //         { urls: "stun:stun2.l.google.com:19302" }
  //       ]
  //     }
  //   });
  //   peer.on("signal", (data) => {
  //     socket.emit("callUser", {
  //       userToCall: mePart,
  //       signalData: data,
  //       from: me,
  //       name: name
  //     });
  //   });
  //   peer.on("stream", (stream) => {
  //     userVideo.current.srcObject = stream;
  //   });
  //   socket.on("callAccepted", (signal) => {
  //     setCallAccepted(true);
  //     peer.signal(signal);
  //   });

  //   connectionRef.current = peer;
  // };

  // const answerCall = () => {
  //   setCallAccepted(true);
  //   const peer = new Peer({
  //     initiator: false,
  //     trickle: false,
  //     stream: stream,
  //     config: {
  //       iceServers: [
  //         { urls: "stun:stun.l.google.com:19302" },
  //         { urls: "stun:stun1.l.google.com:19302" },
  //         { urls: "stun:stun2.l.google.com:19302" }
  //       ]
  //     }
  //   });
  //   peer.on("signal", (data) => {
  //     socket.emit("answerCall", { signal: data, to: caller });
  //   });
  //   peer.on("stream", (stream) => {
  //     userVideo.current.srcObject = stream;
  //   });

  //   peer.signal(callerSignal);
  //   connectionRef.current = peer;
  // };
  const callUser = (mePart) => {
    const peer = new Peer({
      initiator: true,
      trickle: false,
      stream: stream,
      config: {
        iceServers: [
          { urls: "stun:stun.l.google.com:19302" },
          { urls: "stun:stun1.l.google.com:19302" },
          { urls: "stun:stun2.l.google.com:19302" }
        ]
      }
    });

    peer.on("icecandidate", (event) => {
      if (event.candidate) {
        socket.emit("sendIceCandidate", {
          candidate: event.candidate,
          to: mePart
        });
      }
    });

    peer.on("signal", (data) => {
      socket.emit("callUser", {
        userToCall: mePart,
        signalData: data,
        from: me,
        name: name
      })
    });

    peer.on("stream", (stream) => {
      userVideo.current.srcObject = stream
    });

    socket.on("callAccepted", (signal) => {
      setCallAccepted(true)
      peer.signal(signal)
    });

    connectionRef.current = peer
  };

  const answerCall = () => {
    setCallAccepted(true)
    const peer = new Peer({
      initiator: false,
      trickle: false,
      stream: stream,
      config: {
        iceServers: [
          { urls: "stun:stun.l.google.com:19302" },
          { urls: "stun:stun1.l.google.com:19302" },
          { urls: "stun:stun2.l.google.com:19302" }
        ]
      }
    });

    peer.on("icecandidate", (event) => {
      if (event.candidate) {
        socket.emit("sendIceCandidate", {
          candidate: event.candidate,
          to: caller
        });
      }
    });

    peer.on("signal", (data) => {
      socket.emit("answerCall", { signal: data, to: caller })
    });

    peer.on("stream", (stream) => {
      userVideo.current.srcObject = stream
    });

    peer.signal(callerSignal)
    connectionRef.current = peer
  };

  const leaveCall = () => {
    setCallEnded(true);
    connectionRef.current.destroy();
  };
  const [message, setMessage] = useState('');
  const printtag =()=>{
    setMessage("Click the Phone Icon");

  };

  return (
    <>
      <div className="Nav">
        <img src={companylogo} alt=""/>
        <h1 className="headd">Instant Meeting</h1>
      </div>

      <div className="container">
        <div className="video-container">
          <div className="video">
            {stream && <video playsInline muted ref={myVideo} autoPlay style={{ width: "300px" }} />}
          </div>
          <div className="video">
            {callAccepted && !callEnded ?
            <video playsInline ref={userVideo} autoPlay style={{ width: "600px"}} /> :
            null}
          </div>
        </div>
        <div className="myId">
          <CopyToClipboard text={sessionLink} style={{ marginBottom: "2rem" }}>
            <Button variant="contained" color="primary" startIcon={<AssignmentIcon fontSize="large" />}>
              Copy Invite Link
            </Button>
          </CopyToClipboard>

          {/* <TextField
            id="filled-basic"
            label="ID to call"
            variant="filled"
            value={idToCall}
           onChange={(e) => setIdToCall(e.target.value)}
          />  */}
          <div className="call-button">
            {callAccepted && !callEnded ? (
              <Button variant="contained" color="secondary" onClick={leaveCall}>
                End Call
              </Button>
            ) : (
              <IconButton color="primary" aria-label="call" onClick={() => callUser(idToCall)}>
                <PhoneIcon fontSize="large" />
              </IconButton>
            )}
           
           <p>{message}</p>
          </div>
        </div>
        <div className="call-accept">
          {receivingCall && !callAccepted ? (
            <div className="caller">
              <h1 >{name} is calling...</h1>
              <Button variant="contained" color="primary" onClick={answerCall}>
                Answer
              </Button>
            </div>
          ) : null}
        </div>
        
        <div className="btns">
        <div className="capture-button1">
            <Button variant="contained" color="primary" onClick={capturePhoto}>
              Capture Photo
            </Button>
          </div>
          
        
          <div className="capture-button1">
            <Button variant="contained" color="primary" onClick={()=> {Join();printtag()}}>
              Join Meeting 
            </Button>
          </div>

         
          <div className="capture-button1">
            <Button variant="contained" color="primary" onClick={createSession}>
              Create Session
            </Button>
          </div>

          <div className="capture-button1">
            <IconButton color="primary" aria-label="toggle mic" onClick={toggleMic}>
              {isMicMuted ? <MicOffIcon fontSize="large" /> : <MicIcon fontSize="large" />}
            </IconButton>
          </div>

          <div className="capture-button1">
          <IconButton color="primary" aria-label="toggle camera" onClick={toggleCamera}>
           {isVideoMuted ? <VideocamOffIcon fontSize="large" /> : <VideocamIcon fontSize="large" />}
          </IconButton>
          </div>
        </div>
        {capturedPhoto && (
          <div className="captured-photo">
            <h2>Captured Photo</h2>
          <div className="captured-photo1">

            <img src={capturedPhoto} alt="Captured" />
          </div>
          </div>
        )}
      </div>
    </>
  );
}

export default App;
